from fastapi import FastAPI, HTTPException
from fastapi.middleware.cors import CORSMiddleware
from pydantic import BaseModel
from fastapi.staticfiles import StaticFiles
from fastapi.responses import HTMLResponse, FileResponse
import cv2
import numpy as np
import base64
import io
from PIL import Image
import dlib



class VirtualTryOn:
    def __init__(self, predictor_path):
        self.detector = dlib.get_frontal_face_detector()
        self.predictor = dlib.shape_predictor(predictor_path)
    
    def apply_glasses(self, image, glass_img):
        gray = cv2.cvtColor(image, cv2.COLOR_BGR2GRAY)
        faces = self.detector(gray)

        for face in faces:
            landmarks = self.predictor(gray, face)
            left_eye = (landmarks.part(36).x, landmarks.part(36).y)
            right_eye = (landmarks.part(45).x, landmarks.part(45).y)
            nose = (landmarks.part(33).x, landmarks.part(33).y)
            glasses_width = 1.46 * abs(right_eye[0] - left_eye[0])
            scaling_factor = glasses_width / glass_img.shape[1]
            overlay_glasses = cv2.resize(glass_img, None, fx=scaling_factor, fy=scaling_factor, interpolation=cv2.INTER_AREA)

            x = left_eye[0] - int(0.17 * overlay_glasses.shape[1])
            y = nose[1] - int(1.4 * overlay_glasses.shape[0])
            h, w = overlay_glasses.shape[:2]

            if x + w > image.shape[1]:
                w = image.shape[1] - x
                overlay_glasses = overlay_glasses[:, :w]

            if y + h > image.shape[0]:
                h = image.shape[0] - y
                overlay_glasses = overlay_glasses[:h, :]

            if overlay_glasses.shape[2] == 4:
                alpha_mask = overlay_glasses[:, :, 3] / 255.0
                alpha_inv = 1.0 - alpha_mask

                for c in range(0, 3):
                    image[y:y + h, x:x + w, c] = (alpha_mask * overlay_glasses[:, :, c] + alpha_inv * image[y:y + h, x:x + w, c])
            else:
                overlay_img = np.ones(image.shape, np.uint8) * 255
                overlay_img[y:y + h, x:x + w] = overlay_glasses
                gray_glasses = cv2.cvtColor(overlay_img, cv2.COLOR_BGR2GRAY)
                ret, mask = cv2.threshold(gray_glasses, 110, 255, cv2.THRESH_BINARY)
                mask_inv = cv2.bitwise_not(mask)
                temp = cv2.bitwise_and(image, image, mask=mask)
                temp2 = cv2.bitwise_and(overlay_img, overlay_img, mask=mask_inv)
                image = cv2.add(temp, temp2)
        
        return image


app = FastAPI()

# Configuration CORS
app.add_middleware(
    CORSMiddleware,
    allow_origins=["*"],  # Permettre toutes les origines, à personnaliser selon vos besoins
    allow_credentials=True,
    allow_methods=["*"],  # Permettre toutes les méthodes HTTP
    allow_headers=["*"],  # Permettre tous les en-têtes
)

class TryOnRequest(BaseModel):
    photo_base64: str
    glasses_base64: str

def decode_base64_image(base64_data):
    image_data = base64.b64decode(base64_data.split(',')[1])
    image = Image.open(io.BytesIO(image_data))
    return cv2.cvtColor(np.array(image), cv2.COLOR_RGB2BGR)


@app.post("/try_on/")
def try_on(request: TryOnRequest):
    # Decode the base64 images
    photo_img = decode_base64_image(request.photo_base64)
    glass_img = decode_base64_image(request.glasses_base64)

    virtual_try_on = VirtualTryOn('shape_predictor_68_face_landmarks.dat')
    result_image = virtual_try_on.apply_glasses(photo_img, glass_img)

    _, buffer = cv2.imencode('.jpg', result_image)
    result_base64 = base64.b64encode(buffer).decode('utf-8')

    return {"result_image": result_base64}


if __name__ == "__main__":
    import uvicorn
    uvicorn.run(app, host="0.0.0.0", port=8000)

